import React, {Component} from 'react';
import 'bootstrap/dist/css/bootstrap.css';
import './StudentLogin.css';

export default class StudentLogin extends Component {

  render() {
    return (
      <div id = "search">
      <input class="form-control form-control-lg" type="text" placeholder="Search using zipcode or subject name"/>
      <span><button class = "btn-info">Search</button></span>
      </div>

    );

  }

}
